// React
import React, { Component } from "react";

// React Router
import { BrowserRouter as Router, Link } from "react-router-dom";

// Pages

// Bootstrap Components
import { Button, Col, Container, Row } from "react-bootstrap";

class NavProvider extends Component {
  constructor() {
    super();
    this.state = {
      showMenu: false,
    };
    this.showMenu = this.showMenu.bind(this);
    this.closeMenu = this.closeMenu.bind(this);
  }

  showMenu(event) {
    event.preventDefault();
    this.setState({ showMenu: true }, () => {
      document.addEventListener('click', this.closeMenu);
    });
  }

  closeMenu(event) {
    if (!this.dropdownMenu.contains(event.target)) {
      this.setState({ showMenu: false }, () => {
        document.removeEventListener('click', this.closeMenu);
      });
    }
  }

render() {
    return(
        <div>
            <Button className="navButton"><Link className="navLink" onClick={this.showMenu}>Scott Brundle<i class="fas fa-angle-down fasLeft"></i></Link></Button>
            {
                this.state.showMenu ? (
              <div ref={(element) => {this.dropdownMenu = element;}}>
                <Link to="#">
                  <p>Lorem ipsum dolor sit amet</p>
                </Link>
                <hr />
                <Form className="form textAlignLeft">
                  <Form.Group controlId="exampleForm.ControlSelect1">
                    <Form.Label>Label</Form.Label>
                    <Form.Control as="select">
                      <option>Option 1</option>
                      <option>Option 2</option>
                      <option>Option 3</option>
                      <option>Option 4</option>
                    </Form.Control>
                    <Form.Text className="text-muted">Muted Text</Form.Text>
                  </Form.Group>
                  <hr />
                  <div className="formGroup">
                    <Form.Group controlId="formBasicPassword">
                      <Form.Label>Label</Form.Label>
                      <Form.Control type="password" placeholder="Placeholder" />
                      <Form.Text className="text-muted">Muted Text</Form.Text>
                    </Form.Group>
                    <Form.Group controlId="formBasicPassword">
                      <Form.Label>Label</Form.Label>
                      <Form.Control type="password" placeholder="Placeholder" />
                      <Form.Text className="text-muted">Muted Text</Form.Text>
                    </Form.Group>
                  </div>
                  <Link to="#">
                    <p>Search for Multiple Members</p>
                  </Link>
                  <hr />
                  <p className="micro">
                    Lorem ipsum dolor sit amet consectetur adipisicing elit. Quo
                    totam suscipit quisquam qui enim, unde corrupti est cumque
                    velit tempore.
                  </p>
                  <div className="formGroup">
                    <Form.Group controlId="formBasicPassword">
                      <Form.Label>Label</Form.Label>
                      <Form.Control type="password" placeholder="Placeholder" />
                      <Form.Text className="text-muted">Muted Text</Form.Text>
                    </Form.Group>
                    <Form.Group controlId="formBasicPassword">
                      <Form.Label>Label</Form.Label>
                      <Form.Control type="password" placeholder="Placeholder" />
                      <Form.Text className="text-muted">Muted Text</Form.Text>
                    </Form.Group>
                  </div>
                </Form>
              </div>
              )
                : (
                null
                )
            }
        </div>
    )
}
}

export default NavProvider;
